  `status` bit(1) DEFAULT b'1' COMMENT '状态 0不启用 1启用',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`),
  UNIQUE KEY `unique_number` (`unique_number`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_hungarian_ci COMMENT='该表没有在项目中使用';

