/*View structure for view v_db_operations */

/*!50001 DROP TABLE IF EXISTS `v_db_operations` */;
/*!50001 DROP VIEW IF EXISTS `v_db_operations` */;

/*!50001 CREATE ALGORITHM=UNDEFINED  SQL SECURITY DEFINER VIEW `v_db_operations` AS select `t_db_operations`.`id` AS `id`,`t_db_operations`.`time` AS `time`,`t_db_operations`.`ip` AS `ip`,`t_db_operations`.`type` AS `type`,`t_supervisors`.`name` AS `supervisor_name`,`t_supervisors`.`ukey` AS `supervisor_ukey`,`t_db_operations`.`filename` AS `filename` from (`t_db_operations` left join `t_supervisors` on((`t_db_operations`.`supervisor_id` = `t_supervisors`.`id`))) */;

/*View structure for view v_member_details */

/*!50001 DROP TABLE IF EXISTS `v_member_details` */;
/*!50001 DROP VIEW IF EXISTS `v_member_details` */;

/*!50001 CREATE ALGORITHM=UNDEFINED  SQL SECURITY DEFINER VIEW `v_member_details` AS select `t_member_details`.`id` AS `id`,`t_member_details`.`platform_id` AS `platform_id`,(select `t_platforms`.`name` from `t_platforms` where (`t_platforms`.`id` = `t_member_details`.`platform_id`)) AS `platform_name`,`t_member_details`.`member_id` AS `member_id`,(select `t_member_of_platforms`.`platform_member_name` from `t_member_of_platforms` where ((`t_member_of_platforms`.`platform_id` = `t_member_details`.`platform_id`) and (`t_member_of_platforms`.`platform_member_id` = `t_member_details`.`member_id`))) AS `member_name`,`t_member_details`.`serial_number` AS `serial_number`,`t_member_details`.`time` AS `time`,`t_member_details`.`operation` AS `operation`,`t_member_details`.`amount` AS `amount`,`t_member_details`.`status` AS `status`,`t_member_detail_types`.`name` AS `name`,`t_member_details`.`summary` AS `summary` from (`t_member_details` join `t_member_detail_types` on((`t_member_details`.`operation` = `t_member_detail_types`.`id`))) */;

/*View structure for view v_member_events */

/*!50001 DROP TABLE IF EXISTS `v_member_events` */;
/*!50001 DROP VIEW IF EXISTS `v_member_events` */;

/*!50001 CREATE ALGORITHM=UNDEFINED  SQL SECURITY DEFINER VIEW `v_member_events` AS select `t_member_events`.`id` AS `id`,`t_member_events`.`platform_id` AS `platform_id`,(select `t_platforms`.`name` from `t_platforms` where (`t_platforms`.`id` = `t_member_events`.`platform_id`)) AS `platform_name`,`t_member_events`.`member_id` AS `member_id`,(select `t_member_of_platforms`.`platform_member_name` from `t_member_of_platforms` where ((`t_member_of_platforms`.`platform_id` = `t_member_events`.`platform_id`) and (`t_member_of_platforms`.`platform_member_id` = `t_member_events`.`member_id`))) AS `member_name`,`t_member_events`.`time` AS `time`,`t_member_events`.`type_id` AS `type_id`,`t_member_event_types`.`name` AS `name`,`t_member_events`.`descrption` AS `descrption` from (`t_member_events` join `t_member_event_types` on((`t_member_events`.`type_id` = `t_member_event_types`.`id`))) */;

/*View structure for view v_platforms */

/*!50001 DROP TABLE IF EXISTS `v_platforms` */;
/*!50001 DROP VIEW IF EXISTS `v_platforms` */;

/*!50001 CREATE ALGORITHM=UNDEFINED  SQL SECURITY DEFINER VIEW `v_platforms` AS select `t_platforms`.`id` AS `id`,`t_platforms`.`time` AS `time`,`t_platforms`.`name` AS `name`,`t_platforms`.`domain` AS `domain`,`t_platforms`.`gateway_id` AS `gateway_id`,`t_platforms`.`encryption` AS `encryption`,`t_platforms`.`status` AS `status`,`t_platforms`.`use_type` AS `use_type`,`t_platforms`.`deal_status` AS `deal_status`,`t_payment_gateways`.`name` AS `gateway` from (`t_platforms` join `t_payment_gateways` on((`t_platforms`.`gateway_id` = `t_payment_gateways`.`id`))) */;

/*View structure for view v_right_groups */

/*!50001 DROP TABLE IF EXISTS `v_right_groups` */;
/*!50001 DROP VIEW IF EXISTS `v_right_groups` */;

/*!50001 CREATE ALGORITHM=UNDEFINED  SQL SECURITY DEFINER VIEW `v_right_groups` AS select `rg`.`id` AS `id`,`rg`.`name` AS `name`,`rg`.`description` AS `description`,`rg`.`right_modules` AS `right_modules`,(select count(`gos`.`id`) AS `count(gos.id)` from `t_right_groups_of_supervisor` `gos` where (`gos`.`group_id` = `rg`.`id`)) AS `supervisor_count` from `t_right_groups` `rg` */;

/*View structure for view v_supervisor_events */

/*!50001 DROP TABLE IF EXISTS `v_supervisor_events` */;
/*!50001 DROP VIEW IF EXISTS `v_supervisor_events` */;

/*!50001 CREATE ALGORITHM=UNDEFINED  SQL SECURITY DEFINER VIEW `v_supervisor_events` AS select `t_supervisor_events`.`id` AS `id`,`t_supervisor_events`.`supervisor_id` AS `supervisor_id`,`t_supervisor_events`.`time` AS `time`,`t_supervisor_events`.`ip` AS `ip`,`t_supervisor_events`.`type_id` AS `type_id`,`t_supervisor_events`.`descrption` AS `descrption`,concat(`t_supervisors`.`reality_name`,`t_supervisor_events`.`descrption`) AS `content`,`t_supervisors`.`name` AS `supervisor_name`,`t_supervisors`.`level` AS `supervisor_level`,`t_supervisor_event_types`.`name` AS `type_name`,`t_supervisor_event_types`.`description` AS `type_description`,`t_supervisors`.`ukey` AS `ukey` from ((`t_supervisor_events` left join `t_supervisor_event_types` on((`t_supervisor_events`.`type_id` = `t_supervisor_event_types`.`id`))) left join `t_supervisors` on((`t_supervisor_events`.`supervisor_id` = `t_supervisors`.`id`))) */;

/*View structure for view v_supervisors */

/*!50001 DROP TABLE IF EXISTS `v_supervisors` */;
/*!50001 DROP VIEW IF EXISTS `v_supervisors` */;

/*!50001 CREATE ALGORITHM=UNDEFINED  SQL SECURITY DEFINER VIEW `v_supervisors` AS select `t_supervisors`.`id` AS `id`,`t_supervisors`.`time` AS `time`,`t_supervisors`.`name` AS `name`,`t_supervisors`.`reality_name` AS `reality_name`,`t_supervisors`.`password` AS `password`,`t_supervisors`.`password_continuous_errors` AS `password_continuous_errors`,`t_supervisors`.`is_password_error_locked` AS `is_password_error_locked`,`t_supervisors`.`password_error_locked_time` AS `password_error_locked_time`,`t_supervisors`.`is_allow_login` AS `is_allow_login`,`t_supervisors`.`login_count` AS `login_count`,`t_supervisors`.`last_login_time` AS `last_login_time`,`t_supervisors`.`last_login_ip` AS `last_login_ip`,`t_supervisors`.`last_logout_time` AS `last_logout_time`,`t_supervisors`.`email` AS `email`,`t_supervisors`.`telephone` AS `telephone`,`t_supervisors`.`mobile1` AS `mobile1`,`t_supervisors`.`mobile2` AS `mobile2`,`t_supervisors`.`office_telephone` AS `office_telephone`,`t_supervisors`.`fax_number` AS `fax_number`,`t_supervisors`.`sex` AS `sex`,`t_supervisors`.`birthday` AS `birthday`,`t_supervisors`.`level` AS `level`,`t_supervisors`.`is_erased` AS `is_erased`,`t_supervisors`.`creater_id` AS `creater_id`,`t_supervisors`.`ukey` AS `ukey`,`t_supervisors`.`is_customer` AS `is_customer`,`t_supervisors`.`customer_num` AS `customer_num`,(select cast(group_concat(`rg`.`name` separator ',') as char charset utf8) AS `cast(group_concat(``name``) as char)` from (`t_right_groups` `rg` left join `t_right_groups_of_supervisor` `rgos` on((`rg`.`id` = `rgos`.`group_id`))) where (`rgos`.`supervisor_id` = `t_supervisors`.`id`)) AS `right_group` from `t_supervisors` where (isnull(`t_supervisors`.`is_erased`) or (`t_supervisors`.`is_erased` = 0)) */;


